import React from 'react'
import { imageURL } from '../config/config';

function movieActorList({ movieActorInfo }) {
    return (
        <div>
            {
                movieActorInfo.map(actor => (
                    <div>
                        <img src={`${imageURL}/w500/${movieActorInfo.poster_path}`} />
                        <div>{actor.name}</div>
                    </div>
                ))
            }
        </div>
    )
}

export default movieActorList
